    "2013-03-16T00:45:25.357363",nt"name": "telluric-profiles-across-the-darrough-known-geothermal-resource-area-nevada",nt"isopen":
    false,nt"url": null,nt"notes": "Three telluric profiles were completed
    across the Darrough, Nevada K.G.R.A.  One-traverse crossed through the center of
    the area from west to east , another near the south boundary from west to east ,
    and one traverse near the center from south to north.  See data and location map
    for exact positions.  Two five-hundred metre lines were used in a linear array,
    giving a station spacing of one-half km interval .  Only one component between three
    colinear electrodes was used. The array was leap-frogged along a straight profile
    line to obtain running ratios of electric field amplitudes, all referenced back
    to the first dipole location.",nt"license_title": null,nt"extras": [{ntt"key":
